/** 按钮控件，支持通常按钮的属性，方法和事件，缺省是透明无边框。下图为设置了背景色、字体颜色、边框、字体风格、字体标示的效果图 */
export function ui(id: string, name: "do_Button"): DoButton;
/** 
 * UI组件，绝对布局(Absolute Layout),通过设置x,y来设置控件的绝对位置。这是AppWork平台提供的一个核心组件也是最重要的组件之一。绝对布局使用很简单，它内部的所有组件的布局都是绝对坐标值，不过这个坐标值是相对ALayout来说的，不是相对整个屏幕。如下图，按钮的x，y坐标都是100，是相对于按钮所在的ALayout的左上角
 * @link {http://www.appworker.net/awdoc/web/img/20180329/c58d8cc8ca5a49c498e399f13b06bdf6.png}
 *  */
export function ui(id: string, name: "do_Alayout"): DoALayout;
/**
 * 条码扫描视图，能设置view的基本属性，宽高等，扫描框内有矩形校正区域，扫描时有简单的动画显示，支持一维码、二维码（包括QR码、DM码等），若想在页面已启动时就加载扫描功能，建议将start方法放在do_Page的loaded事件回调中执行。
 * @link {http://www.appworker.net/awdoc/web/img/20180329/9f3e9b12a49742a5af8ba7db7a9b94c7.png}
 */
export function ui(id: string, name: "do_BarcodeView"): DoBarcodeView;
/** 支持2D图形处理，可以画点，线，多边形，文字，图片。样式的修改必须在定义图形之前才会生效。 */
export function ui(id: string, name: "do_Canvas"): DoCanvas;
/** 点击控件会弹出一个选择列表，单击选项即可选中 */
export function ui(id: string, name: "do_ComboBox"): DoComboBox;
/** 多页面滑动视图，支持从最左侧或右侧边缘滑出视图，整体侧滑视图带有缩放和渐变效果； */
export function ui(id: string, name: "do_FragmentView"): DoFragmentView;
/** 帧动画视图，可以加载gif动图，也可以将多张图片组合设置为动图效果。 */
export function ui(id: string, name: "do_FrameAnimationView"): DoFrameAnimationView;
/** GridView是一个二维网格滚动视图，可将数据源中的一条数据显示为表格中的一个cell，若设置为多模版，需要模板的大小相同。 */
export function ui(id: string, name: "do_GridView"): DoGridView;
/** 这个组件用于浏览大量网络或本地图片，图片路径可以http://链接或本地data://、source://目录，支持手势缩放原图，多图片支持左右滑动预览 */
export function ui(id: string, name: "do_ImageBrowserView"): DoImageBrowserView;
/** 图片控件，可以设置图片背景，也可以设置点击事件作为特殊的按钮使用，当不清楚原图大小时可设置宽高为-1，会显示原始大小的宽高 */
export function ui(id: string, name: "do_ImageView"): DoImageView;
/** 文本标签框，用于显示文本文字，设置字体样式、大小、内容对齐 */
export function ui(id: string, name: "do_Label"): DoLabel;
/** 线性布局，是AppWork提供的最基础的布局组件之一. */
export function ui(id: string, name: "do_LinearLayout"): DoLinearLayout;
/** List视图是最常用的UI组件，由很多个Cell组成。它可以通过bind一个ListData来构造视图的数据Model，修改数据来更新视图。android平台不支持在cell中放TextField、TextBox组件。 */
export function ui(id: string, name: "do_ListView"): DoListView;
/** 可以设置基于值填充的进度条和显示重复模式的进度条 */
export function ui(id: string, name: "do_ProgressBar"): DoProgressBar;
/** 滚动视图，支持上下和左右滚动两种类型，只有滚动视图内的组件宽、高超过滚动视图自身的宽、高时才可以滚动，滚动视图只能包含一个子组件，通常都是一个ALayout或LinearLayout。 */
export function ui(id: string, name: "do_ScrollView"): DoScrollView;
/** 分段选择视图，支持手势滑动和点击选中一个index，通常和do_SlideView结合在一起使用，互相联动；当height=-1时，表示自动宽度 */
export function ui(id: string, name: "do_SegmentView"): DoSegmentView;
/** 这个UI组件包含多个子视图(UI文件），实现多个子视图之间左右平缓滑动效果，通过设置looping属性支持无限循环滑动，该组件还支持设置多个不同模板视图 */
export function ui(id: string, name: "do_SlideView"): DoSlideView;
/** 超级播放器是基于腾讯云点播SDK-TXVodPlayer实现的集视频信息拉取、横竖屏切换、清晰度选择等功能于一体的UI视图组件。帮助您在短时间内，打造一个媲美市面上各种流行视频App的播放体验。视频云SDK不会对播放地址的来源做限制，即您可以用它来播放腾讯云或非腾讯云的播放地址。但视频云SDK中的播放器只支持FLV 、RTMP 和 HLS（m3u8）三种格式的直播地址，以及 MP4、 HLS（m3u8）和 FLV 三种格式的点播地址。！支持 HLS(m3u8) 和 MP4 两种常见的格式(点播和普通网络)的缓存功能。！ */
export function ui(id: string, name: "do_TencentVodPlayerView"): DoTencentVodPlayerView;
/** 通常只能输入多行数据，当高度设置为-1时，默认会显示一行文字的高度 */
export function ui(id: string, name: "do_TextBox"): DoTextBox;
/** 通常只允许输入一行 */
export function ui(id: string, name: "do_TextField"): DoTextField;
/** ViewShower是一个包含多个子VIew的UI容器组件，每个子View的大小和容器大小一致，切换每个View可以添加动画效果，并且可以保持每个View的最后显示状态，支持动态的添加或删除。因为每一个子View在内存里都有对应的对象，所以用户不能在这个容器里添加太多子View。通常这个组件用于整个App的主界面，和底部一个BottomBar结合使用，点击底部按钮，切换不同的视图。 */
export function ui(id: string, name: "do_ViewShower"): DoViewShower;
/** webview */
export function ui(id: string, name: "do_WebView"): DoWebView;
/** 集成百度地图，实现基本的地图功能，包括设置中心点，添加标记等 */
export function ui(id: string, name: "do_BaiduMapView"): DoBaiduMapView;
